X = sm.add_constant(X)

new_annotations =np.array(new_annotations)[:,-1]
y = np.array([ann for ann in new_annotations])  # New 4th parameter

# Add a constant to the independent variable matrix (for the intercept)
X = sm.add_constant(X)

# Create and fit the model
model = sm.OLS(y, X).fit()

# Print the summary of the regression
print(model.summary())

# Get the coefficients and intercept
coefficients = model.params
intercept = coefficients[0]
slope = coefficients[1]

print(f"Coefficients: {coefficients}")
print(f"Intercept: {intercept}")

# Example formula
print(f"New 4th parameter = {intercept} + {slope} * (ratio of original annotations)")


import numpy as np
import statsmodels.api as sm
from sklearn.linear_model import Ridge
from sklearn.model_selection import train_test_split, cross_val_score
from sklearn.metrics import mean_squared_error

# Calculate the ratio of the second and first elements of each annotation
ratios = np.array([ann[1] / ann[0] for ann in original_annotations]).reshape(-1, 1)

# Apply log transformation
log_ratios = np.log(ratios)

# Combine features into a single matrix
X = np.hstack([ratios, log_ratios])

# Split the data into training and testing sets
X_train, X_test, y_train, y_test = train_test_split(X, new_annotations, test_size=0.2, random_state=42)

# Apply Ridge regression
ridge_model = Ridge(alpha=1.0)
ridge_model.fit(X_train, y_train)

# Predict and evaluate the model
y_pred = ridge_model.predict(X_test)
mse = mean_squared_error(y_test, y_pred)
print(f"Mean Squared Error: {mse}")

# Apply cross-validation
cv_scores = cross_val_score(ridge_model, X, new_annotations, cv=5, scoring='neg_mean_squared_error')
mean_cv_score = -cv_scores.mean()
print(f"Mean Cross-Validation MSE: {mean_cv_score}")

# Print the coefficients
print(f"Coefficients: {ridge_model.coef_}")
print(f"Intercept: {ridge_model.intercept_}")

# Example formula
print(f"New 4th parameter = {ridge_model.intercept_} + {ridge_model.coef_[0]} * (ratio of original annotations) + {ridge_model.coef_[1]} * (log of ratio of original annotations)")